import { Component } from '@angular/core';
import {  OnInit, Sanitizer } from '@angular/core';
import { DomSanitizer, SafeUrl } from '@angular/platform-browser';
import { UserService } from '../service/user.service';
import { LoginService } from '../service/login.service';
import { Router } from '@angular/router';
import { BreakpointObserver, Breakpoints } from '@angular/cdk/layout';
import { Observable, map, shareReplay } from 'rxjs';

@Component({
  selector: 'app-navigation-bar',
  templateUrl: './navigation-bar.component.html',
  styleUrls: ['./navigation-bar.component.css']
})
export class NavigationBarComponent implements OnInit  {
  isHandset$: Observable<boolean> = this.breakpointObserver.observe(Breakpoints.Handset)
    .pipe(
      map(result => result.matches),
      shareReplay()
    );


  imageSrc:SafeUrl='';
  type:String="login";
  flag:boolean=true;
  flag1:boolean=false;
  userName:String = "";
  constructor(private userService:UserService,private sanitizer:DomSanitizer,private logSer:LoginService,private router:Router,private breakpointObserver: BreakpointObserver){}
  ngOnInit(): void {
    if(this.logSer.getLoginStatus()){
      if(this.type==="login"){
        this.type="logout"
      }
      this.flag=false;
      this.flag1=true;
    this.userService.getProfileImg().subscribe((data:any)=>{
      if(data && data.imageData){
        const imageData = data.imageData;
        const binaryData = atob(imageData);
        const arrayBuffer = new ArrayBuffer(binaryData.length);
        const uint8Array = new Uint8Array(arrayBuffer);
        for (let i = 0; i < binaryData.length; i++) {
          uint8Array[i] = binaryData.charCodeAt(i);
        }
        const blob = new Blob([uint8Array], { type: 'image/png' });
        this.imageSrc = this.sanitizer.bypassSecurityTrustUrl(URL.createObjectURL(blob));
      }
    })

    this.userService.getUserName().subscribe((data:any)=>{
    this.userName = data.name;

    })
  } 
  }

  clicked(){
    if(this.type==="logout"){
      localStorage.clear();
      this.logSer.onFailure();
      this.router.navigateByUrl("/home")
      window.location.reload();
      this.type="login"
      this.flag=true;
      this.flag1=false
        }
  }

  add(){
    this.router.navigateByUrl('/addRestaurant');
  }

  home(){
    this.router.navigateByUrl('/restaurantView')
  }

  addFoodItems(){
    this.router.navigateByUrl('/addItem');
  }
}
